import logo from "../assets/search.gif";
import styles from "./NavBar.module.css"

function NavBar() {
        return (
                <>
		<img className={styles.searchImage} src={logo} />
		<form>
		<div>
		<label htmlFor="search" className={styles.searchword}></label>
		<input id="search" type="text" className={styles.searchbar} />
		</div>
		</form>
                </>
        );
}

export default NavBar;
